    }
}

class YXN : Product {
    override init() {
        super.init()
        name = "YXN"
    }
}

class MainVC {

    func afterReqeust(productType: String) {
        var product : Product 

        if productType == "AXN" {
            product = AXN()
        } else if productType == "YXN" {
            product = YXN()
